import React, { useState } from 'react'; // import 로 useState 를 불러온다!
import styled from 'styled-components';
const LeftArea = () => {
    const MainSection = styled.section`
        margin: 0px;
        padding:0px;
`; //ContentWarp 메인 css

    const WarpSection = styled.div`
        margin: 0 16vw;
    `;
    const LeftSection = styled.main`
        display: flex;
        justify-content: space-between;

    `;
    const Title = styled.h1`
        margin: 50px 0 27px;
    `
    const TitleText = styled.p`
        color:#2b6699;
        font-size: 24px;
        font-weight: 700;
        line-height: 27px;
    `
    return(
        <MainSection>
            <WarpSection>
                <LeftSection>
                    <section>
                        <Title>

                        </Title>
                    </section>
                </LeftSection>
            </WarpSection>
        </MainSection>
    )
}
export default LeftArea;
